INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1, 1000001, 190801, 3.414, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 62, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", -416.5, "カリン", 2, 1, 1, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1, 1000002, 190801, 3.099, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 62, "ミッションをクリアして、\n報酬をゲットしましょう！", -416.5, "カリン", 2, 1, 2, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1, 1000003, 190801, 2.801, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 63, "受け取ることができる\n報酬があるようです\n確認してみてください", -416.5, "カリン", 2, 1, 3, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (2, 1000004, 190801, 0.0, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 63, "報酬がもらえますよ！\nチェックしてみてください", -416.5, "カリン", 2, 1, 4, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (2, 1000005, 190801, 2.12, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 64, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", -363.0, "カリン", 1, 1, 5, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1, 1000006, 190801, 1.68, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 64, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", -363.0, "カリン", 2, 1, 6, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (2, 1000007, 190801, 2.33, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 64, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", -363.0, "カリン", 1, 1, 7, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (3, 1020101, 133701, 5.18, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 61, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", -285.0, "ラビリスタ", 7, 10201, 101, -6.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1, 1020102, 133901, 8.77, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 61, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", -285.0, "クリスティーナ", 2, 10201, 201, -2.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (6, 1020103, 133801, 15.5, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 61, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", -285.0, "ネネカ", 1, 10201, 301, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (2, 1020201, 134301, 9.061, "2030/01/01 14:59:59", "2025/02/28 12:00:00", 61, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", -285.0, "ランファ", 5, 10202, 101, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1, 1020202, 134401, 7.699, "2030/01/01 14:59:59", "2025/02/28 12:00:00", 61, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", -285.0, "チカ", 2, 10202, 201, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1, 1020301, 134601, 8.595, "2030/01/01 14:59:59", "2025/03/31 12:00:00", 61, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", -285.0, "アオイ", 2, 10203, 101, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1, 1020302, 134501, 7.758, "2030/01/01 14:59:59", "2025/03/31 12:00:00", 61, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", -285.0, "クローチェ", 2, 10203, 201, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (2, 1020401, 132302, 7.0, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 61, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", -285.0, "ルイズマリー", 6, 10204, 101, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (1, 1020402, 132402, 7.904, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 61, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", -285.0, "イロハ", 2, 10204, 201, 0.0);
INSERT INTO `v1_f0bd82009756089dccebff514cf79ccb3204c6be05623840a2eeb8016be27834` VALUES (4, 1020403, 132502, 8.487, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 61, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", -285.0, "ソノ", 2, 10204, 301, 0.0);
